[Form]
public class ROROrderAmendmentDialog extends FormRun
{
    ROROrderAmendmentDialogType orderAmendmentDialogType;

    DirPartyRecId               party;
    InfologText                 warningString;
    DNRReasonType               reasonType;

    boolean                     validateConnectedToOrder;
    boolean                     validatedOrderLineStatus;
    boolean                     validateReturned;
    boolean                     validateAutoCreateCreditNote;
    boolean                     validateInvoiced;
    boolean                     validateSynchronizeFromParent;
    boolean                     validateExchange;
    boolean                     validateReplacement;


}

public void closeOk()
{
    if(element.validate())
    {
        super();

        orderAmendmentDialogType.parmTmpOrderAmendmentDialogTable(RORTmpOrderAmendmentDialogTable);

        if (reasonType == DNRReasonType::DateChange
        ||  reasonType == DNRReasonType::OnOffDateChange)
        {
            orderAmendmentDialogType.parmRentalDateTimes(RORRentalDateTimes);
        }
    }
}

public void exchangeGroupChanged()
{
    RORTmpOrderAmendmentDialogTable.ExchangeType = Commercial.optionValue() == 1 ? RORAmendmentExchangeType::Commercial : RORAmendmentExchangeType::Technical;
    if (RORTmpOrderAmendmentDialogTable.ExchangeType == RORAmendmentExchangeType::Technical)
    {
        RORRentalLine   rentalLine = orderAmendmentDialogType.parmCommon();
        RORTmpOrderAmendmentDialogTable.ItemIdRequested = rentalLine.ItemId;
        RORTmpOrderAmendmentDialogTable_ds.reread();
        RORTmpOrderAmendmentDialogTable_ds.refresh();
    }

    element.updateDesign();
}

public void init()
{
    if (!element.args().caller()
    ||  !SysDictClass::isEqualOrSuperclass(classIdGet(element.args().caller()), classNum(DialogRunbase)))
    {
        throw error(Error::wrongUseOfFunction(funcName()));
    }

    orderAmendmentDialogType        = element.args().caller().runbase();
    party                           = orderAmendmentDialogType.findDirPartyRecId();
    warningString                   = orderAmendmentDialogType.getWarningText();
    reasonType                      = orderAmendmentDialogType.reasonType();
    [validateConnectedToOrder,
     validatedOrderLineStatus,
     validateReturned,
     validateAutoCreateCreditNote,
     validateInvoiced,
     validateSynchronizeFromParent,
     validateExchange,
     validateReplacement] = orderAmendmentDialogType.getValidationContainer();

    super();

    if (warningString)
    {
        Warning.visible(true);
        WarningText.text(warningString);
    }

    switch (reasonType)
    {
        case DNRReasonType::ExchangeItem:
            element.exchangeGroupChanged();
            break;

        default:
            break;
    }

    this.updateDesign();
}

public void rentalStopEffectivityGroupChanged()
{
    boolean freeRange = ((reasonType == DNRReasonType::RentalStop && OneDay.optionValue() == 1) ||
                         (reasonType == DNRReasonType::ResetValue && ResetValueOneDay.optionValue() == 1) ||
                         (reasonType == DNRReasonType::BlockedPeriod && BlockedPeriodOneDay.optionValue() == 1));

    orderAmendmentDialogType.parmRentalStopOneDayActive(freeRange);

    RORTmpOrderAmendmentDialogTable_ds.object(fieldNum(RORTmpOrderAmendmentDialogTable, RentalStopDate)).mandatory(freeRange);
    RORTmpOrderAmendmentDialogTable_ds.object(fieldNum(RORTmpOrderAmendmentDialogTable, EffectiveDateTimeFrom)).mandatory(!freeRange);
    RORTmpOrderAmendmentDialogTable_ds.object(fieldNum(RORTmpOrderAmendmentDialogTable, EffectiveDateTimeTo)).mandatory(!freeRange);
}

public void updateDesign()
{
    DictEnum        dictEnum;
    Common          common;
    RORRentalLine   rentalLine;

    common = orderAmendmentDialogType.parmCommon();

    dictEnum = new DictEnum(enumNum(DNRReasonType));
    if (orderAmendmentDialogType.reasonType() == DNRReasonType::OnOffDateChange)
    {
        element.design().caption("@DNR10083");
    }
    else
    {
        element.design().caption(dictEnum.value2Label(orderAmendmentDialogType.reasonType()));
    }

    reasonType = orderAmendmentDialogType.reasonType();
    TabLostOrder.visible(reasonType == DNRReasonType::LostOrder);
    TabChangeRentalDate.visible(reasonType == DNRReasonType::DateChange);
    TabExchange.visible(reasonType == DNRReasonType::ExchangeItem);
    TabRentalStop.visible(reasonType == DNRReasonType::RentalStop);
    TabCredit.visible(reasonType == DNRReasonType::Credit);
    TabResetValue.visible(reasonType == DNRReasonType::ResetValue);
    TabBlockPeriod.visible(reasonType == DNRReasonType::BlockedPeriod);
    TabChangeOnOffRentalDate.visible(reasonType == DNRReasonType::OnOffDateChange);

    switch (reasonType)
    {
        case DNRReasonType::DateChange,
             DNRReasonType::OnOffDateChange:
            WarningText.displayHeight(!validateConnectedToOrder      ? WarningText.displayHeight() + 4 : WarningText.displayHeight());
            WarningText.displayHeight(!validatedOrderLineStatus      ? WarningText.displayHeight() + 3 : WarningText.displayHeight());
            WarningText.displayHeight(!validateReturned              ? WarningText.displayHeight() + 1 : WarningText.displayHeight());
            WarningText.displayHeight(!validateAutoCreateCreditNote  ? WarningText.displayHeight() + 1 : WarningText.displayHeight());
            WarningText.displayHeight(!validateInvoiced              ? WarningText.displayHeight() + 1 : WarningText.displayHeight());
            WarningText.displayHeight(!validateSynchronizeFromParent ? WarningText.displayHeight() + 1 : WarningText.displayHeight());
            WarningText.displayHeight(!validateExchange              ? WarningText.displayHeight() + 1 : WarningText.displayHeight());
            WarningText.displayHeight(!validateReplacement           ? WarningText.displayHeight() + 1 : WarningText.displayHeight());

            RORTmpOrderAmendmentDialogTable_ds.object(fieldNum(RORTmpOrderAmendmentDialogTable, SynchronizeSubRental)).visible(false);//(!validateConnectedToOrder);
            RORTmpOrderAmendmentDialogTable_ds.object(fieldNum(RORTmpOrderAmendmentDialogTable, TerminationNote)).visible(common.TableId == tableNum(SalesLine));
            PurchFormLetter_PurchaseOrder.visible(common.TableId == tableNum(PurchTable) || common.TableId == tableNum(PurchLine));
            SalesFormLetter_Confirmation.visible(common.TableId == tableNum(SalesTable) || common.TableId == tableNum(SalesLine));
            break;

        case DNRReasonType::ExchangeItem:
            rentalLine = common;
            ExchangeTemplates.enabled(rentalLine.ParentLineRecId || rentalLine.KitComponentType == RORKitComponentType::Standalone);
            RORTmpOrderAmendmentDialogTable_ds.object(fieldNum(RORTmpOrderAmendmentDialogTable, MakeObjectUnavailable)).allowEdit(orderAmendmentDialogType.canObjectAvailabilityBeUpdated());
            RORTmpOrderAmendmentDialogTable_ds.object(fieldNum(RORTmpOrderAmendmentDialogTable, OffRentDateTime)).mandatory(true);
            RORTmpOrderAmendmentDialogTable_ds.object(fieldNum(RORTmpOrderAmendmentDialogTable, RequestedPickupDateTime)).mandatory(true);
            RORTmpOrderAmendmentDialogTable_ds.object(fieldNum(RORTmpOrderAmendmentDialogTable, ItemIdRequested)).mandatory(RORTmpOrderAmendmentDialogTable.ExchangeType == RORAmendmentExchangeType::Commercial);
            PurchFormLetter_PurchaseOrder.visible(common.TableId == tableNum(PurchLine));
            SalesFormLetter_Confirmation.visible(common.TableId == tableNum(SalesLine));
            break;

        case DNRReasonType::RentalStop:
            PurchFormLetter_PurchaseOrder.visible(common.TableId == tableNum(PurchLine));
            SalesFormLetter_Confirmation.visible(common.TableId == tableNum(SalesLine));
            break;

        case DNRReasonType::Credit:
            RORTmpOrderAmendmentDialogTable_ds.object(fieldNum(RORTmpOrderAmendmentDialogTable, EffectiveDateTimeFrom)).mandatory(true);
            RORTmpOrderAmendmentDialogTable_ds.object(fieldNum(RORTmpOrderAmendmentDialogTable, EffectiveDateTimeTo)).mandatory(true);
            break;
    }

}

public boolean validate()
{
    boolean             ret;
    RORRentalDateTimes  rentalDateTimesCheck;
    DNRCalendarId       calendarId;
    TimeZone            userTimeZone = DateTimeUtil::getUserPreferredTimeZone();
    TimeZone            timeZoneOrder;
    RORRentalDateTime   startDateTime;
    RORRentalDateTime   endDateTime;

    ret = true;

    if (!RORTmpOrderAmendmentDialogTable.ContactPersonId)
    {
        ret = checkFailed(strFmt("@SYS26332", fieldId2pname(tableNum(RORTmpOrderAmendmentDialogTable), fieldNum(RORTmpOrderAmendmentDialogTable, ContactPersonId))));
    }

    switch (reasonType)
    {
        case DNRReasonType::DateChange,
             DNRReasonType::OnOffDateChange:
            rentalDateTimesCheck = RORRentalDateTimes::findReference(RORRentalDateTimes.RefTableId, RORRentalDateTimes.RefRecId);

            if (!RORRentalDateTimes::isModified(rentalDateTimesCheck, RORRentalDateTimes))
            {
                ret = checkFailed("@DNR6365");
            }

            if (rentalDateTimesCheck.OffRentDateTime != RORRentalDateTimes.OffRentDateTime)
            {
                ret = ret && RORTmpOrderAmendmentDialogTable.validateBlockedPeriodsRange(rentalDateTimesCheck.OffRentDateTime);
            }

            if (rentalDateTimesCheck.OnRentDateTime != RORRentalDateTimes.OnRentDateTime)
            {
                ret = ret && RORTmpOrderAmendmentDialogTable.validateBlockedPeriodsRange(rentalDateTimesCheck.OnRentDateTime);
            }
            break;

        case DNRReasonType::ExchangeItem:
            if (RORTmpOrderAmendmentDialogTable.ExchangeType == RORAmendmentExchangeType::Commercial
            &&  !RORTmpOrderAmendmentDialogTable.ItemIdRequested)
            {
                ret = checkFailed(strFmt("@SYS26332", fieldId2pname(tableNum(RORTmpOrderAmendmentDialogTable), fieldNum(RORTmpOrderAmendmentDialogTable, ItemIdRequested))));
            }

            if (!RORTmpOrderAmendmentDialogTable.OffRentDateTime)
            {
                ret = checkFailed(strFmt("@SYS26332", fieldId2pname(tableNum(RORTmpOrderAmendmentDialogTable), fieldNum(RORTmpOrderAmendmentDialogTable, OffRentDateTime))));
            }

            if (!RORTmpOrderAmendmentDialogTable.RequestedPickupDateTime)
            {
                ret = checkFailed(strFmt("@SYS26332", fieldId2pname(tableNum(RORTmpOrderAmendmentDialogTable), fieldNum(RORTmpOrderAmendmentDialogTable, RequestedPickupDateTime))));
            }

            ret = ret && RORTmpOrderAmendmentDialogTable.validateBlockedPeriodsRange(RORTmpOrderAmendmentDialogTable.OffRentDateTime);
            break;

        case DNRReasonType::RentalStop:
            switch (RORTmpOrderAmendmentDialogTable.CalendarType)
            {
                case RORRentalCalendarType::RentalStop:
                    calendarId = RORParameters::find().RentalStopCalendar;
                    if (!calendarId)
                    {
                        ret = checkFailed(strFmt("@DNR6387", fieldId2pname(tableNum(RORParameters), fieldNum(RORParameters, RentalStopCalendar)), tableId2pname(tableNum(RORParameters))));
                    }
                    break;

                case RORRentalCalendarType::RentalActivation:
                    calendarId = RORParameters::find().RentalActiveCalendar;
                    if (!calendarId)
                    {
                        ret = checkFailed(strFmt("@DNR6387", fieldId2pname(tableNum(RORParameters), fieldNum(RORParameters, RentalActiveCalendar)), tableId2pname(tableNum(RORParameters))));
                    }
                    break;

                default:
                    return ret;
            }

            switch (RORTmpOrderAmendmentDialogTable.RefTableId)
            {
                case tableNum(PurchLine):
                    timeZoneOrder = PurchLine::findRecId(RORTmpOrderAmendmentDialogTable.RefRecId).RORRentalLine::FINTimeZoneOrder();

                    break;

                case tableNum(SalesLine):
                    timeZoneOrder = SalesLine::findRecId(RORTmpOrderAmendmentDialogTable.RefRecId).RORRentalLine::FINTimeZoneOrder();

                    break;
            }

            if (orderAmendmentDialogType.parmRentalStopOneDayActive())
            {
                // When the rental stop starts on the on rent date or
                // stops at the off rent date then take the time off the on rent/off rent time
                rentalDateTimesCheck = orderAmendmentDialogType.findRentalDateTimes();

                startDateTime  = DateTimeUtil::applyTimeZoneOffset(rentalDateTimesCheck.OnRentDateTime , DateTimeUtil::getOriginatingTimeZone(rentalDateTimesCheck.OnRentDateTime ));
                endDateTime    = DateTimeUtil::applyTimeZoneOffset(rentalDateTimesCheck.OffRentDateTime, DateTimeUtil::getOriginatingTimeZone(rentalDateTimesCheck.OffRentDateTime));

                if (RORTmpOrderAmendmentDialogTable.RentalStopDate == DateTimeUtil::date(startDateTime))
                {
                    startDateTime = rentalDateTimesCheck.OnRentDateTime;
                }
                else
                {
                    startDateTime = DateTimeUtil::removeTimeZoneOffset(DateTimeUtil::newDateTime(RORTmpOrderAmendmentDialogTable.RentalStopDate, 0), timeZoneOrder);
                }

                if (RORTmpOrderAmendmentDialogTable.RentalStopDate == DateTimeUtil::date(endDateTime))
                {
                    endDateTime = rentalDateTimesCheck.OffRentDateTime;
                }
                else
                {
                    endDateTime = DateTimeUtil::removeTimeZoneOffset(DateTimeUtil::newDateTime(RORTmpOrderAmendmentDialogTable.RentalStopDate + 1, 0), timeZoneOrder);
                }
            }
            else
            {
                this.validateEffectiveDatesFilled();

                startDateTime = DateTimeUtil::removeTimeZoneOffset(DateTimeUtil::applyTimeZoneOffset(RORTmpOrderAmendmentDialogTable.EffectiveDateTimeFrom, userTimeZone), timeZoneOrder);
                endDateTime   = DateTimeUtil::removeTimeZoneOffset(DateTimeUtil::applyTimeZoneOffset(RORTmpOrderAmendmentDialogTable.EffectiveDateTimeTo  , userTimeZone), timeZoneOrder);
            }                   

            ret = ret && RORTmpOrderAmendmentDialogTable.validateBlockedPeriodsRange(RORTmpOrderAmendmentDialogTable.RentalStopDate ? startDateTime : DateTimeUtil::minValue());
            break;

        case DNRReasonType::Credit :
            this.validateEffectiveDatesFilled();

            ret = ret && RORTmpOrderAmendmentDialogTable.validateBlockedPeriodsRange();
            break;

        case DNRReasonType::ResetValue :
            if (orderAmendmentDialogType.parmRentalStopOneDayActive())
            {
                // When the rental stop starts on the on rent date or
                // stops at the off rent date then take the time off the on rent/off rent time
                rentalDateTimesCheck = orderAmendmentDialogType.findRentalDateTimes();

                startDateTime  = DateTimeUtil::applyTimeZoneOffset(rentalDateTimesCheck.OnRentDateTime , DateTimeUtil::getOriginatingTimeZone(rentalDateTimesCheck.OnRentDateTime ));
                endDateTime    = DateTimeUtil::applyTimeZoneOffset(rentalDateTimesCheck.OffRentDateTime, DateTimeUtil::getOriginatingTimeZone(rentalDateTimesCheck.OffRentDateTime));

                if (RORTmpOrderAmendmentDialogTable.RentalStopDate == DateTimeUtil::date(startDateTime))
                {
                    startDateTime = rentalDateTimesCheck.OnRentDateTime;
                }
                else
                {
                    switch (RORTmpOrderAmendmentDialogTable.RefTableId)
                    {
                        case tableNum(PurchLine):
                            timeZoneOrder = PurchLine::findRecId(RORTmpOrderAmendmentDialogTable.RefRecId).RORRentalLine::FINTimeZoneOrder();

                            break;

                        case tableNum(SalesLine):
                            timeZoneOrder = SalesLine::findRecId(RORTmpOrderAmendmentDialogTable.RefRecId).RORRentalLine::FINTimeZoneOrder();

                            break;
                    }

                    startDateTime = DateTimeUtil::removeTimeZoneOffset(DateTimeUtil::newDateTime(RORTmpOrderAmendmentDialogTable.RentalStopDate, 0), timeZoneOrder);
                }
            }
            else
            {
                this.validateEffectiveDatesFilled();
            }

            ret = ret && RORTmpOrderAmendmentDialogTable.validateBlockedPeriodsRange(RORTmpOrderAmendmentDialogTable.RentalStopDate ? startDateTime : DateTimeUtil::minValue());
            break;
    }

    return ret;
}

public boolean validateEffectiveDatesFilled()
{
    boolean ret;

    if (!RORTmpOrderAmendmentDialogTable.EffectiveDateTimeTo)
    {
        ret = checkFailed(strFmt("@SYS26332", "@SYS177352"));
    }

    if (!RORTmpOrderAmendmentDialogTable.EffectiveDateTimeFrom)
    {
        ret = checkFailed(strFmt("@SYS26332", "@DNR1039"));
    }

    return ret;
}

