public void initValue()
{
    Common  common = orderAmendmentDialogType.parmCommon();

    super();


    RORTmpOrderAmendmentDialogTable.RefTableId = common.TableId;
    RORTmpOrderAmendmentDialogTable.RefRecId   = common.RecId;
    RORTmpOrderAmendmentDialogTable.AmendmentType = orderAmendmentDialogType.reasonType();

    if (RORTmpOrderAmendmentDialogTable.AmendmentType == DNRReasonType::ExchangeItem)
    {
        RORTmpOrderAmendmentDialogTable.ExchangeType = RORAmendmentExchangeType::Commercial;
    }

    if (RORTmpOrderAmendmentDialogTable.AmendmentType == DNRReasonType::DateChange
    || RORTmpOrderAmendmentDialogTable.AmendmentType == DNRReasonType::OnOffDateChange)
    {
        RORTmpOrderAmendmentDialogTable.TerminationNote = DNRAdditionalNoteTable::find(common.TableId, common.RecId).TerminationNote;
    }
}

edit ContactPersonName editContactPersonName(boolean                            _set,
                                             RORTmpOrderAmendmentDialogTable    _tmpOrderAmendmentDialogTable,
                                             ContactPersonName                  _name)
{
    ContactPersonName   name = _name;
    ContactPerson       contactPerson;
    DirPartyTable       partyTable;
    ContactPersonId     contactPersonId;

    if (_set)
    {
        if (name)
        {
            contactPersonId                               = _tmpOrderAmendmentDialogTable.ContactPersonId;
            contactPerson                                 = ContactPerson::find(_name);
            _tmpOrderAmendmentDialogTable.ContactPersonId = contactPerson.ContactPersonId;

            if (_tmpOrderAmendmentDialogTable.ContactPersonId)
            {
                name = contactPerson.personName();
            }
            else
            {
                select firstOnly ContactPersonId from contactPerson
                where contactPerson.ContactForParty == party
                    join Name from partyTable
                    where partyTable.RecId   == contactPerson.Party
                    &&    partyTable.Name  like name;

                if (contactPerson)
                {
                    _tmpOrderAmendmentDialogTable.ContactPersonId = contactPerson.ContactPersonId;
                    name                                          = partyTable.Name;
                }
            }
        }
        else
        {
            _tmpOrderAmendmentDialogTable.ContactPersonId = '';
        }
    }
    else
    {
        name = ContactPerson::name(_tmpOrderAmendmentDialogTable.ContactPersonId);
    }

    return name;
}

public void modified()
{
    super();

    OneDay.enabled(RORTmpOrderAmendmentDialogTable.CalendarType != RORRentalCalendarType::ResetCalendar);

    if (RORTmpOrderAmendmentDialogTable.CalendarType == RORRentalCalendarType::ResetCalendar)
    {
        RentalStopFreeRange.optionValue(1);
        element.rentalStopEffectivityGroupChanged();
    }
}

public void jumpRef()
{
    Args args;

    args = new Args();

    args.caller(element);

    Common callingRecord = orderAmendmentDialogType.parmCommon();
    switch(callingRecord.TableId)
    {
        case tableNum(PurchTable):
            PurchTable purchTable = PurchTable::findRecId(callingRecord.RecId);
            args.record(purchTable.partyTable_OrderAccount());
            break;

        case tableNum(SalesTable):
            SalesTable salesTable = SalesTable::findRecId(callingRecord.RecId);
            args.record(salesTable.partyTable_CustAccount());
            break;
    }

    new MenuFunction(MenuItemDisplayStr(ContactPersonEdit),MenuItemType::Display).run(args);

    //super();
}

