private void updateDesign()
{
    WPPTaskType taskType;

    if (isConfigurationkeyEnabled(configurationKeyNum(RORPreparationDateTime)))
    {
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, PreparationDateTime)).allowEdit(validatedOrderLineStatus && validateReturned && validateReplacement);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, PreparationDate)).allowEdit(validatedOrderLineStatus && validateReturned && validateReplacement);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, PreparationTime)).allowEdit(validatedOrderLineStatus && validateReturned && validateReplacement);
    }

    if (isConfigurationkeyEnabled(configurationKeyNum(ROROutboundDateTime)))
    {
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OutboundDateTime)).allowEdit(validatedOrderLineStatus && validateReturned && validateReplacement);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OutboundDate)).allowEdit(validatedOrderLineStatus && validateReturned && validateReplacement);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OutboundTime)).allowEdit(validatedOrderLineStatus && validateReturned && validateReplacement);
    }

    if (isConfigurationkeyEnabled(configurationKeyNum(RORRequestedDeliveryDateTime)))
    {
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, RequestedDeliveryDateTime)).allowEdit(validatedOrderLineStatus && validateReturned && validateReplacement);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, RequestedDeliveryDate)).allowEdit(validatedOrderLineStatus && validateReturned && validateReplacement);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, RequestedDeliveryTime)).allowEdit(validatedOrderLineStatus && validateReturned && validateReplacement);
    }

    if (isConfigurationkeyEnabled(configurationKeyNum(ROROnRentDateTime)))
    {
        if (reasonType == DNRReasonType::OnOffDateChange)
        {
            RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OnRentDateTime)).allowEdit(validateInvoiced);
            RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OnRentDate)).allowEdit(validateInvoiced);
            RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OnRentTime)).allowEdit(validateInvoiced);
        }
        else
        {
            RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OnRentDateTime)).allowEdit(validatedOrderLineStatus && validateReturned && validateExchange && validateReplacement);
            RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OnRentDate)).allowEdit(validatedOrderLineStatus && validateReturned && validateExchange && validateReplacement);
            RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OnRentTime)).allowEdit(validatedOrderLineStatus && validateReturned && validateExchange && validateReplacement);
        }
    }

    if (isConfigurationkeyEnabled(configurationKeyNum(RORBuildDateTime)))
    {
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, BuildDateTime)).allowEdit(validateReturned && validateExchange);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, BuildDate)).allowEdit(validateReturned && validateExchange);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, BuildTime)).allowEdit(validateReturned && validateExchange);
    }

    if (isConfigurationkeyEnabled(configurationKeyNum(ROREventStartDateTime)))
    {
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, EventStartDateTime)).allowEdit(validateReturned && validateExchange);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, EventStartDate)).allowEdit(validateReturned && validateExchange);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, EventStartTime)).allowEdit(validateReturned && validateExchange);
    }

    if (isConfigurationkeyEnabled(configurationKeyNum(ROREventEndDateTime)))
    {
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, EventEndDateTime)).allowEdit(validateReturned && validateExchange);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, EventEndDate)).allowEdit(validateReturned && validateExchange);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, EventEndTime)).allowEdit(validateReturned && validateExchange);
    }

    if (isConfigurationkeyEnabled(configurationKeyNum(RORStrikeDateTime)))
    {
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, StrikeDateTime)).allowEdit(validateReturned && validateExchange);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, StrikeDate)).allowEdit(validateReturned && validateExchange);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, StrikeTime)).allowEdit(validateReturned && validateExchange);
    }

    if (isConfigurationkeyEnabled(configurationKeyNum(RORExpectedOffRentDateTime)))
    {
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, ExpectedOffRentDateTime)).allowEdit(validateReturned && validateExchange);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, ExpectedOffRentDate)).allowEdit(validateReturned && validateExchange);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, ExpectedOffRentTime)).allowEdit(validateReturned && validateExchange);
    }

    if (isConfigurationkeyEnabled(configurationKeyNum(ROROffRentDateTime)))
    {
        if (reasonType == DNRReasonType::OnOffDateChange)
        {
            RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OffRentDateTime)).allowEdit((!validateReturned || !validateInvoiced) && validateExchange);
            RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OffRentDate)).allowEdit((!validateReturned || !validateInvoiced) && validateExchange);
            RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OffRentTime)).allowEdit((!validateReturned || !validateInvoiced) && validateExchange);
        }
        else
        {
            RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OffRentDateTime)).allowEdit(validateReturned && validateExchange);
            RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OffRentDate)).allowEdit(validateReturned && validateExchange);
            RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OffRentTime)).allowEdit(validateReturned && validateExchange);
        }
    }

    if (isConfigurationkeyEnabled(configurationKeyNum(RORRequestedPickupDateTime)))
    {
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, RequestedPickupDateTime)).allowEdit(validateReturned);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, RequestedPickupDate)).allowEdit(validateReturned);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, RequestedPickupTime)).allowEdit(validateReturned);
    }

    if (isConfigurationkeyEnabled(configurationKeyNum(RORInboundDateTime)))
    {
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, InboundDateTime)).allowEdit(validateReturned);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, InboundDate)).allowEdit(validateReturned);
        RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, InboundTime)).allowEdit(validateReturned);
    }

    if (reasonType == DNRReasonType::DateChange
    &&  WPPWorkOrderTable::existFromOrder(orderAmendmentDialogType.parmCommon().TableId, orderAmendmentDialogType.parmCommon().RecId))
    {
        taskType = OrderAmendmentDialogType.getTaskType();

        switch (taskType)
        {
            case WPPTaskType::Delivery:
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, PreparationDateTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, PreparationDate)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, PreparationTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OutboundDateTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OutboundDate)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OutboundTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, RequestedDeliveryDateTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, RequestedDeliveryDate)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, RequestedDeliveryTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OnRentDateTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OnRentDate)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OnRentTime)).allowEdit(false);
                break;


            case WPPTaskType::Load:
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, PreparationDateTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, PreparationDate)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, PreparationTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OutboundDateTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OutboundDate)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OutboundTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, RequestedDeliveryDateTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, RequestedDeliveryDate)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, RequestedDeliveryTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OnRentDateTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OnRentDate)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OnRentTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, BuildDateTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, BuildDate)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, BuildTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, EventStartDateTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, EventStartDate)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, EventStartTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, EventEndDateTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, EventEndDate)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, EventEndTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, StrikeDateTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, StrikeDate)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, StrikeTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, ExpectedOffRentDateTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, ExpectedOffRentDate)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, ExpectedOffRentTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OffRentDateTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OffRentDate)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, OffRentTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, RequestedPickupDateTime)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, RequestedPickupDate)).allowEdit(false);
                RORRentalDateTimes_ds.object(fieldNum(RORRentalDateTimes, RequestedPickupTime)).allowEdit(false);
                break;

            default:
                break;
        }
    }

}

public void init()
{
    if (reasonType == DNRReasonType::DateChange
    || reasonType == DNRReasonType::OnOffDateChange)
    {
        super();

        // BP Deviation documented - DynaRent
        RORRentalDateTimes.setTmp();
        RORRentalDateTimes.data(orderAmendmentDialogType.findRentalDateTimes());
        RORRentalDateTimes.insert();

        this.updateDesign();
    }
}

