{
    boolean ret;

    ret = super();
    ret = RORRentalDateTimes.validateBusinessObjectAvailability(RORRentalDateTimes.ExpectedOffRentDateTime);

    return ret;
}

public void modified()
{
    ROROrderAmendmentDialogType_ChangeDate  orderAmendmentDialogType_ChangeDate;
    str                                     warningStringLocal;

    super();

    if (RORRentalDateTimes.OffRentDateTime)
    {
        RORTmpOrderAmendmentDialogTable.TerminationNumber = RORRentalDateTimes.OffRentDateTime != orderAmendmentDialogType.findRentalDateTimes().OffRentDateTime ?
                                                            RORTmpOrderAmendmentDialogTable::generateTerminationNumber(RORTmpOrderAmendmentDialogTable.TerminationNumber) :
                                                            0;
    }
    else
    {
        RORTmpOrderAmendmentDialogTable.TerminationNumber = 0;
    }

    if (orderAmendmentDialogType is ROROrderAmendmentDialogType_ChangeDate
    &&  RORRentalDateTimes.OffRentDateTime != orderAmendmentDialogType.findRentalDateTimes().OffRentDateTime)
    {
        orderAmendmentDialogType_ChangeDate = orderAmendmentDialogType;
        warningStringLocal = orderAmendmentDialogType_ChangeDate.getWarningText_OffRentBeforeInvoiced(RORRentalDateTimes.OffRentDateTime);

        if (warningStringLocal)
        {
            warningString += ((warningString ? '\n' : '') + warningStringLocal);
            WarningText.displayHeight(WarningText.displayHeight() + 1);
            Warning.visible(true);
            WarningText.text(warningString);
        }
    }

    RORTmpOrderAmendmentDialogTable_ds.refresh();
}

